<?php if (!defined('__TYPECHO_ROOT_DIR__')) exit;
  if ($this->is('single')) {
    if ($this->options->toc) {
      $this->content = createCatalog($this->content);
    }
    $this->content = preg_replace('/<img(.*?)src=[\'"]([^\'"]+)[\'"](.*?)>/i',"<noscript>\$0</noscript><img\$1data-src=\"\$2\" \$3>",$this->content);
  }
  ?>
<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">

	<title><?php $this->archiveTitle(array(
			'category'  =>  _t('%s 下的文章'),
			'search'    =>  _t('包含关键字 %s 的文章'),
			'tag'       =>  _t('标签 %s 下的文章'),
			'author'    =>  _t('%s 的文章')
		), '', ' - '); ?><?php
		$this->options->title();
		if ($this->is('index') && $this->options->subtitle != '') echo " - {$this->options->subtitle}";
	?></title>

	<!-- Favicon -->
	<link href="<?php
		if ($this->options->logoUrl == '') {
			$this->options->themeUrl("images/logo.png");
		} else {
			$this->options->logoUrl();
		}
	?>" rel="icon" type="image/png">

	<!-- Fonts -->
	<link href="https://rbtree.app/fcss.txt" rel="stylesheet">

	<!-- FontAwesome -->
	<link href="https://rbtree.app/font-awesome.min.css" rel="stylesheet">

	<!-- Main CSS -->
	<link type="text/css" href="<?php $this->options->themeUrl("assets/css/main.min.css"); ?>" rel="stylesheet">

	<!-- KaTeX CSS -->
	<?php if ($this->options->katex): ?>
	<link rel="stylesheet" type="text/css" href="https://rbtree.app/katex.min.css">
	<?php endif; ?>

	<!-- PrismJS CSS -->
	<?php if ($this->options->prismjs): ?>
	<link rel="stylesheet" type="text/css" href="https://cdn.jsdelivr.net/npm/prismjs@1.20.0/themes/<?php $this->options->prismTheme(); ?>.css" />
	<link rel="stylesheet" type="text/css" href="https://rbtree.app/prism-toolbar.css" />
		<?php if ($this->options->prismLine): ?>
		<link rel="stylesheet" type="text/css" href="https://rbtree.app/prism-line-numbers.css" />
		<?php endif; ?>
	<?php endif; ?>

	<!-- Viewer CSS -->
	<?php if ($this->options->viewerEnable): ?>
	<link rel="stylesheet" type="text/css" href="https://rbtree.app/viewer.min.css" />
	<?php endif; ?>

	<!-- Jquery -->
	<script src="https://rbtree.app/jquery.min.js"></script>

	<!-- Custom CSS -->
	<?php if ($this->options->customCss): ?>
	<style type="text/css"><?php $this->options->customCss(); ?></style>
	<?php endif; ?>

